import { findByLabelText } from "@testing-library/react";
import { NavLink } from "react-router-dom";

const Stylednavbar = () => {
  return (
    <nav className="flex gap-4 font-mono bg-[#696667FF] text-[#964F4CFF] h-11 text-4">
      <NavLink to="/" className="underline font-bold">
        Home
      </NavLink>
      <NavLink
        to="about"
        className={({ isActive }) =>
          isActive ? "underline text-emerald-400" : "text-blue-300"
        }
      >
        About Me
      </NavLink>
      <NavLink to="projects" className="underline font-bold">
        Projects
      </NavLink>
      <NavLink to="contact" className="underline font-bold">
        Contact
      </NavLink>
    </nav>
  );
};

export default Stylednavbar;
